How do you select the right videographer for your big day?

Along with an awesome planner and wedding photographer, a videographer is one of your vendors you don't want to wait long to book! 

So here are our top 5 tips to finding the perfect videographer:

1. Get to Know Their Personalities (do you get along, do they see your vision?)

2. Find a Style You're Obsessed With!

3. Use the Referral Method

4. Read Reviews— what are other brides saying?

5. Go for 'Experience': Tenured & Customer-centric vendors!  Anything can happen in a wedding/elopement, you’ll want someone who not only has experience handling it, but someone who has your best interest at heart!

